import React, { Component } from 'react';
import './index.css';

class BookCard extends Component {
    render() {
        console.log('bookcard - ', this.props.book)
        return (
            <div className="book-card">
                <div className="book-information">
                    <div className="title">
                        {this.props.book.title}
                    </div>
                    <div className="author">
                        {this.props.book.author}
                    </div>
                </div>

                <div className="library-information">
                    <div className="copies"><span className="quantity">{this.props.book.quantity}</span> copies left</div>
                    {
                        this.props.book.is_reserved
                        ? <button className="unreserve">Unreserve</button>
                        : <button className="reserve">Reserve</button>
                    }
                </div>
            </div>
        )
    }
}

export default BookCard;
